(1, '2009-02-20 10:24:49', '2012-02-04 01:26:21', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Forgot Password', 'we will send this mail, when user submit the forgot password form.', 'Forgot password', 'Hi ##USERNAME##,\n\nA password reset request has been made for your user account at ##SITE_NAME##.\n\nIf you made this request, please click on the following link:\n\n##RESET_URL##\n\nIf you did not request this action and feel this is in error, please contact us.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'USERNAME,RESET_URL,SITE_NAME,SITE_URL', 0),
(2, '2009-02-20 10:15:57', '2010-12-02 06:32:29', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Activation Request', 'we will send this mail, when user registering an account he/she will get an activation request.', 'Please activate your ##SITE_NAME## account', 'Hi ##USERNAME##,\r\n\r\nYour account has been created. \r\nPlease visit the following URL to activate your account.\r\n##ACTIVATION_URL##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'SITE_NAME,USERNAME,ACTIVATION_URL', 0),
(3, '2009-02-20 10:15:19', '2009-07-01 08:27:46', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New User Join', 'we will send this mail to admin, when a new user registered in the site. For this you have to enable "admin mail after register" in the settings page.', 'New user joined in ##SITE_NAME## account', 'Hi, \r\n\r\nA new user named "##USERNAME##" has joined in ##SITE_NAME## account. \r\n\r\nUsername:##USERNAME##\r\nEmail: ##USEREMAIL##\r\nSignup IP:##SIGNUPIP##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'SITE_NAME,USERNAME,SITE_URL,USEREMAIL,SIGNUPIP', 0),
(4, '2009-03-02 00:00:00', '2009-07-01 08:28:47', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Add', 'we will send this mail to user, when a admin add a new user.', 'Welcome to ##SITE_NAME##', 'Hi ##USERNAME##, \r\n\r\n##SITE_NAME## team added you as a user in ##SITE_NAME##. \r\n\r\nYour account details.\r\nUsername:##USERNAME##\r\nEmail: ##EMAILID##\r\nPassword:##PASSWORD##\r\n\r\nPlease visit the following URL to activate your account \r\n##ACTIVATION_URL##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'SITE_NAME,ACTIVATION_URL,USERNAME,PASSWORD,EMAILID', 0),
(5, '2009-05-22 16:51:14', '2009-07-01 08:28:59', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Welcome Email', 'we will send this mail, when user register in this site and get activate.', 'Welcome to ##SITE_NAME##', 'Hi ##USERNAME##,\r\n\r\nWe wish to say a quick hello and thanks for registering at ##SITE_NAME##.\r\n\r\nIf you did not request this account and feel this is in error, please\r\ncontact us at ##SUPPORT_EMAIL##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'SITE_NAME, USERNAME, SUPPORT_EMAIL,SITE_URL', 0),
(6, '2009-05-11 19:24:45', '2011-02-19 01:05:20', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New Comment Photo', 'we will send this mail, when a user get new comment on his photo.', '##USERNAME## wrote on your Photo...', 'Hi ##PHOTO_USERNAME##, \n\n##USERNAME## wrote on your Photo\n\n"##COMMENT##"\n\nTo see your Photo comment, follow the link below:\n##PHOTO_LINK##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'USERNAME,COMMENT,PHOTO_LINK,SITE_NAME', 0),
(7, '2009-05-22 16:45:38', '2012-01-25 09:45:04', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Active ', 'We will send this mail to user, when user active   \r\nby administator.', 'Your ##SITE_NAME## account has been activated', 'Hi ##USERNAME##,\n\nYour account has been activated.\n\nThanks,\n ##SITE_NAME## - ##SITE_URL##', 'SITE_NAME,USERNAME,SITE_URL', 0),
(8, '2009-05-22 16:48:38', '2009-07-01 08:29:23', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Deactivate', 'We will send this mail to user, when user deactive by administator.', 'Your ##SITE_NAME## account has been deactivated', 'Hi ##USERNAME##,\r\n\r\nYour ##SITE_NAME## account has been deactivated.\r\n\r\nThanks,\r\n##SITE_NAME##', 'SITE_NAME,USERNAME', 0),
(9, '2009-05-22 16:50:25', '2012-02-02 05:50:38', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Delete', 'We will send this mail to user, when user delete by administrator.', 'Your ##SITE_NAME## account has been removed', 'Hi ##USERNAME##,\n\nYour ##SITE_NAME## account has been removed.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME', 0),
(10, '2009-07-07 15:47:09', '2009-07-07 15:47:09', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin Change Password', 'we will send this mail to user, when admin change user''s password.', 'Password changed', 'Hi ##USERNAME##,\r\n\r\nAdmin reset your password for your  ##SITE_NAME## account.\r\n\r\nYour new password: ##PASSWORD##\r\n\r\nThanks,\r\n##SITE_NAME##', 'SITE_NAME,PASSWORD,USERNAME', 0),
(45, '2009-10-14 19:20:59', '2012-01-24 08:36:19', '"##SITE_NAME## (auto response)" <productdemo.admin+noreply+paertplanet@gmail.com>', '', 'Auto Reply for Register Venue Owner', 'we will send this mail ti user, when user submit the contact us form.', 'Thank you for register', 'Hi ##FIRST_NAME####LAST_NAME##,\n\nThank you for registering as a venue owner at ##SITE_NAME##. You will contacted by our team to provide you with your login information.\n   \nThanks,\n##SITE_NAME##\n##SITE_URL##', 'MESSAGE, POST_DATE, SITE_NAME, CONTACT_URL, FIRST_NAME, LAST_NAME, SUBJECT, SITE_URL', 0),
(44, '2009-10-14 18:31:14', '2009-10-14 18:31:14', '##FIRST_NAME####LAST_NAME## <##FROM_EMAIL##>', '##FROM_EMAIL##', 'Venue Owner Registered', 'We will send this mail to admin, when user submit any contact form.', 'Venue Owner Register', 'Hi,\r\n  New Venue owner registered to our site\r\n\r\nVenue Owner Details\r\n----------------------------------------------------\r\nFirst Name   : ##FIRST_NAME##\r\nLast Name    : ##LAST_NAME##\r\nEmail        : ##FROM_EMAIL##\r\nGender       : ##GENDER##\r\nDOB          : ##DOB##\r\nMobile       : ##MOBILE##\r\nOther Mobile  : ##TELEPHONE##\r\nVenue Name   : ##VENUE_NAME##\r\nVenue Type   : ##VENUE_TYPE##\r\nIP           : ##IP##, ##SITE_ADDR##\r\nWhois        : http://whois.sc/##IP##\r\n----------------------------------------------------\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'FROM_URL, IP, TELEPHONE, MESSAGE, SITE_NAME, SUBJECT, FROM_EMAIL, LAST_NAME, FIRST_NAME', 0),
(43, '2009-10-14 19:20:59', '2011-02-24 12:45:03', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Party Plan', 'we will send this mail to admin, when user add the new party plan.', 'New Proposal for Party Plan', 'Party Plan Details\n----------------------------------------------------\nParty Type      : ##PARTY_NAME##\nName              : ##NAME##\nEmail               : ##FROM_EMAIL##\nDate Of Party   : ##DATE_OF_PARTY##\nCity                 : ##CITY_NAME##\nCountry           : ##COUNTRY_NAME##\nZip Code          : ##ZIP_CODE##\nIP                   : ##IP##, ##SITE_ADDR##\nWhois              : http://whois.sc/##IP##\n---------------------------------------------------------', 'MESSAGE, POST_DATE, SITE_NAME, CONTACT_URL, FIRST_NAME, LAST_NAME, SUBJECT, SITE_URL', 0),
(31, '2009-03-02 00:00:00', '2009-03-02 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New Message', 'we will send this mail, when a user get new message', '##USERNAME## sent you a message on ##SITE_NAME##...', '##USERNAME## sent you a message.\r\n\r\n--------------------\r\n##MESSAGE##\r\n--------------------\r\n\r\nTo reply to this message, follow the link below:\r\n##MESSAGE_LINK##\r\n\r\n\r\nThanks,\r\n##SITE_NAME##', 'USERNAME,MESSAGE,MESSAGE_LINK,SITE_NAME', 0),
(32, '2009-03-02 00:00:00', '2009-03-02 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Event cancelation', 'we will send this mail, when a event canceled by event organisor', '##EVENTNAME## has been canceld due to some reason', 'Hi ##USERNAME##,\r\nYou are decided to attend  an event \r\n##EVENTNAME## on ##SITE_NAME##,which has beed canceled by event creator  due to some reason , sorry for the inconvinience.\r\n\r\nThanks,\r\n##SITE_NAME##', 'USERNAME,SITE_NAME,EVENTNAME', 0),
(33, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Venue Suggestion', 'we will send this mail, when a Venue Suggestion by user', '##VenueName## Inforamtion Modified', 'Hi ##USERNAME##,\r\nVenue information has been  modified  information \r\n\r\nVenue name: ##VenueName##\r\nAddress: ##Address##\r\nAddress2: ##Address2##\r\nZipCode: ##ZipCode##\r\nCity: ##City##\r\nCountry: ##Country##\r\nState: ##State##\r\nStreet: ##Street##\r\nPhone: ##Phone##\r\nEmail: ##Email##\r\nWebsite: ##Website##\r\nDoorPolicy: ##DoorPolicy##\r\nCapacity: ##Capacity##\r\nVenueCategory: ##VenueCategory##\r\nMusic: ##Music##\r\nOpenStatus: ##OpenStatus##\r\nImportBeerPrice:##ImportBeerPrice##\r\nDomesticBeerPrice:##DomesticBeerPrice##\r\nWellDrinkPrice: ##WellDrinkPrice##\r\nSoftDrinkPrice: ##SoftDrinkPrice##\r\nParkingType: ##ParkingType##\r\nVenueFeature: ##VenueFeature##\r\nEmployeeSize: ##EmployeeSize##\r\nSquareFootage: ##SquareFootage##\r\nDescription: ##Description##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'USERNAME,VenueName,Address,Address2,ZipCode,City,Country,State,Street,Phone,Email,Website,Description,DoorPolicy,Capacity,VenueCategory,Music,OpenStatus,ImportBeerPrice,DomesticBeerPrice,WellDrinkPrice,SoftDrinkPrice,ParkingType,VenueFeature,EmployeeSize,SquareFootage,SITE_NAME', 0),
