(35, '2009-10-14 19:20:59', '2009-10-14 19:20:59', '"##SITE_NAME## (auto response)" <productdemo.admin+noreply+paertplanet@gmail.com>', '', 'Contact Us Auto Reply', 'we will send this mail ti user, when user submit the contact us form.', '[##SITE_NAME##] RE: ##SUBJECT##', 'Hi ##FIRST_NAME####LAST_NAME##,\r\n\r\n   Thanks for contacting us. We''ll get back to you shortly.\r\n\r\n   Please do not reply to this automated response. If you have not contacted us and if you feel this is an error, please contact us through our site ##CONTACT_URL##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##\r\n\r\n------ On ##POST_DATE## you wrote from ##IP## -----\r\n\r\n##MESSAGE##\r\n', 'MESSAGE, POST_DATE, SITE_NAME, CONTACT_URL, FIRST_NAME, LAST_NAME, SUBJECT, SITE_URL', 0),
(36, '0000-00-00 00:00:00', '2012-02-04 08:26:17', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Invite a friend', 'we will\r\nsend this mail, when user sends invitation through inviter.', 'Invitation from ##USERNAME## about ##SITE_NAME##', 'Hi,\r\nYour friend ##USERNAME## at ##SITE_NAME##, had sent you the following message.\r\n\r\nHis message:\r\nI have joined the ##SITE_NAME## network. I wish to invite you to ##SITE_NAME## as well.\r\n\r\nto follow him, click in this URL:\r\n##SITE_LINK##\r\n\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'USERNAME,SITE_NAME,MESSAGE,REGISTER_URL,SITE_URL', 0),
