(1, 1296144326, 2, 0, 40, 0, 'Maintenance Statistics Report\n=====================================\n\n- Maintenance start run time is 2011-01-27 16:05:26 UTC\n- Maintenance statistics last updated intermediate table statistics to 2011-01-27 14:59:59 UTC.\n- Current time must be after 2011-01-27 15:59:59 UTC for the next intermediate table update to happen\n- Maintenance statistics last updated final table statistics to 2011-01-27 14:59:59 UTC.\n- Current time must be after 2011-01-27 15:59:59 UTC for the next intermediate table update to happen\n- Maintenance statistics will be run.\n- The intermediate table statistics will be updated.\n- The final table statistics will be updated.\n\n- Migrating bucket-based logged data to the statistics tables.\n- Saving request, impression, click and conversion data into the final tables.\n- Updating the data_summary_ad_hourly table for data after 2011-01-27 15:00:00 UTC.\n- Logging the completion of the maintenance statistics run.'),
