r or debt settlement services \r\ninvolve the sales of products or services identified by government agencies to have a high likelihood of being fraudulent \r\nviolate applicable laws or industry regulations regarding the sale of (a) tobacco products, or (b) prescription drugs and devices\r\ninvolve gambling, gaming and/or any other activity with an entry fee and a prize, including, but not limited to casino games, sports betting, horse or greyhound racing, lottery tickets, other ventures that facilitate gambling, games of skill (whether or not it is legally defined as a lottery) and sweepstakes unless the operator has obtained prior approval from PayPal and the operator and customers are located exclusively in jurisdictions where such activities are permitted by law.', NULL, 0, 1, 2, 0, NULL, '/acceptable-use-policy', 'acceptable-use-policy', 0);
