(40, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 15, 'Facebook', 'Facebook is used for login and posting message using its account details. For doing above, our site must be configured with existing Facebook account. <a href="http://dev1products.dev.agriya.com/doku.php?id=facebook-setup"> http://dev1products.dev.agriya.com/doku.php?id=facebook-setup </a>'),
(41, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 15, 'Twitter', 'Twitter is used for login and posting message using its account details. For doing above, our site must be configured with existing Twitter account. <a href="http://dev1products.dev.agriya.com/doku.php?id=twitter-setup"> http://dev1products.dev.agriya.com/doku.php?id=twitter-setup </a>'),
(42, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 15, 'Yahoo', 'We use this service for importing contacts from Yahoo for friends invite. For doing above, our site must be configured with existing Yahoo account. <a href="http://dev1products.dev.agriya.com/doku.php?id=yahoo-setup"> http://dev1products.dev.agriya.com/doku.php?id=yahoo-setup </a>'),
(43, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 15, 'Gmail', 'We use this service for importing contacts from Gmail for friends invite. For doing above, our site must be configured with existing Gmail account. <a href="http://dev1products.dev.agriya.com/doku.php?id=google_setup"> http://dev1products.dev.agriya.com/doku.php?id=google_setup </a>'),
(44, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 15, 'MSN', 'We use this service for importing contacts from MSN for friends invite. For doing above, our site must be configured with existing MSN account. <a href="http://dev1products.dev.agriya.com/doku.php?id=msn-setup"> http://dev1products.dev.agriya.com/doku.php?id=msn-setup </a>'),
(45, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 15, 'Google Translations', '<p>We use this service for quick translation to support new languages in ##TRANSLATIONADD##.</p> <p>Note that Google Translate API is now a <a href="http://code.google.com/apis/language/translate/v2/pricing.html" target="_blank">paid service</a>. Getting Api key, refer <a href="http://dev1products.dev.agriya.com/doku.php?id=google-translation-setup" target="_blank">http://dev1products.dev.agriya.com/doku.php?id=google-translation-setup</a>.</p>'),
(46, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 16, 'Module', 'Here you can modify module settings such as enabling/disabling master modules settings.'),
(47, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 10, 'Configuration', '<p>Here you can update the Suspicious Words Detector related settings.</p>\r\n<p>Here you can place various words, which accepts regular expressions also, to match with your terms and policies.  </p>\r\n<h4>Common Regular expressions</h4>\r\n<dl class="list clearfix">\r\n	<dt>Email</dt>\r\n<dd>\\w+([-+.]\\w+)*@\\w+([-.]\\w+)*\\.\\w+([-.]\\w+)*([,;]\\s*\\w+([-+.]\\w+)*@\\w+([-.]\\w+)*\\.\\w+([-.]\\w+)*)*</dd>\r\n	<dt>Phone Number</dt>\r\n<dd>\r\n^0[234679]{1}[\\s]{0,1}[\\-]{0,1}[\\s]{0,1}[1-9]{1}[0-9]{6}$</dt>\r\n	<dt>URL</dt>\r\n<dd>((https?|ftp|gopher|telnet|file|notes|ms-help):((//)|(\\\\\\\\))+[\\w\\d:#@%/;$()~_?\\+-=\\\\\\.&]*)</dd>\r\n\r\n</dl>'),
